class Semibooks extends Component {

    state = {
        books: BOOKS,
    };

    render() {

        const books = this.state.books.map((book) => {
            return <Seminew book={book} key={book.id} />
        });
        return (
            <div className='allsemibooks' style={{display:'inline-block' }}>

                {books}


            </div>
        )

    }

}

